        /// <summary>R11客户端根据最后一次心跳执行信息清理</summary>
        public static void R11ClearInfoByLastHeartbeatTime()
        {
            if (R11CliInfo.IsEmpty)
            {
                return;
            }
            else
            {
                /*
                 设计思路:
                 R11客户端,每隔2分40秒就会触发TXN=GetPingSites被动心跳.
                 在GetPingSites(Packet p)方法调用UpdateHeartbeatTime()更新最后一次心跳时间LastHeartbeatTime
                 帐号登录成功,调用此方法.主动检查R11CliInfo是否有死链接[直接拔网线,突然断网那种情况],有就删除掉.
                 */

                DateTime nowTime = DateTime.Now, lastHeartbeatTime;

                foreach (var kv in R11CliInfo)
                {
                    lastHeartbeatTime = kv.Value.LastHeartbeatTime;

                    // 最后一次心跳+5分30秒(漏1次心跳)
                    if (lastHeartbeatTime.AddMinutes(5).AddSeconds(30) <= nowTime)
                    {
                        R11CliInfo.TryRemove(kv.Key, out _r11 _);
                    }
                }
            }
        }

        public static void R11AndR34ClearInfo(int OID)
