        /// <summary>获取用户信息</summary>
        /// <param name="PKey">士兵角色Key(特征码)</param>
        /// <param name="OIDB_18395">连接18395端口的SocketChilkatID</param>
        /// <param name="PId">士兵角色Id(等于帐户Id(数据库自增Id)Ps:用户刚注册好帐户未创建士兵角色时PId为零)</param>
        /// <param name="PName">士兵角色名</param>
        /// <param name="UId">帐户Id(数据库自增ID)</param>
        /// <returns>_r11</returns>
        public static _r11? GetUserInfo(string? PKey = null, int OIDB_18395 = 0, int PId = 0, string? PName = null, int UId = 0)
        {
            if (R11CliInfo.IsEmpty)
            {
                return null;
            }
            else
            {
                foreach (var kv in R11CliInfo)
                {
                    if (!string.IsNullOrEmpty(PKey) && kv.Value.PKey.Equals(PKey))
                    {
                        return kv.Value;
                    }
                    else if (OIDB_18395 != 0 && kv.Value.OIDB_18395 == OIDB_18395)
                    {
                        return kv.Value;
                    }
                    else if (PId != 0 && kv.Value.PId == PId)
                    {
                        return kv.Value;
                    }
                    else if (!string.IsNullOrEmpty(PName) && kv.Value.PName.Equals(PName))
                    {
                        return kv.Value;
                    }
                    else if (UId != 0 && kv.Value.UId == UId)
                    {
                        return kv.Value;
                    }
                }
                return null;
            }
        }

