        /// <summary>Rank等级处理0-50</summary>
        public static int GetRankByScore(double score = 0)
        {
            if (score < 6500)
            {
                return 0;
            }
            double[] levelScore ={
                // 1-10
                11000, 18500, 28000, 40000, 53000, 68000, 84000, 100000, 120000, 138000, 
                // 11-20
                158000, 179000, 200000, 224000, 247000, 272000, 297000, 323000, 350000, 377000,
                // 21-30
                405000, 437000, 472000, 537000, 620000, 720000, 832000, 956000, 1090000, 1240000,
                // 31-40
                1400000, 1550000, 1730000, 1900000, 2100000, 2300000, 2500000, 2700000, 2900000, 3140000,
                // 41-49
                3370000, 3600000, 3800000, 4010000, 4300000, 4600000, 4900000, 5100000, 5400000
            };
            for (int i = 1; i <= levelScore.Length; i++)
            {
                if (score < levelScore[i]) { return i; }
            }
            return 50;
        }

