        /// <summary>业务处理</summary>
        public static void BusinessProcessing(Packet p)
        {
            // ShowPacket(p);

            switch (p.PORT)
            {
                case r34p_Port:
                    _18321.Handle(p);
                    break;
                case r34t_Port:
                    _18326.Handle(p);
                    break;
                case r11p_Port:
                    _18390.Handle(p);
                    break;
                case r11t_Port:
                    _18395.Handle(p);
                    break;
                default:
                    ShowUnknownPacket(p);
                    break;
            }
        }

        public static void ShowPacket(Packet p, string[]? cmd = null, string[]? txn = null)
        {
            if (cmd != null)
            {
                if (p.CMD.ContainsKeyWord(cmd))
                {
                    return;
                }
            }
            if (txn != null)
            {
                if (p.TXN.ContainsKeyWord(txn))
                {
                    return;
                }
            }
            Console.WriteLine($"---------------------------------------\n显示:数据信息->触发端口:{p.PORT}=>命令:{p.CMD}=>内容:{p.RXS}");
        }
        public static void ShowUnknownPacket(Packet p)
        {
            Console.WriteLine($"---------------------------------------\n警告:未处理包->触发端口:{p.PORT}=>命令:{p.CMD}=>内容:{p.RXS}");
        }

        public static void SendMsg(Packet p, string msg, int errorCode)
        {
            p.Add("TXN", p.TXN);
            p.Add("errorContainer.[]", 0);
            p.Add("localizedMessage", msg);
            p.Add("errorCode", errorCode);
            p.Send();
        }

        /// <summary>BC2字符串替换</summary>
        public static string FilterString (string p)
        {
            return p
                .Replace(":", "%3a")
                .Replace("|", "%7c")
                .Replace("=", "%3d");
        }

